var com;
(function (com) {
    var justinwatkins;
    (function (justinwatkins) {
        var Main = (function () {
            function Main() {
                var module = angular.module('com.justin-watkins.home', ['ui.router']);
                module.run(['$rootScope', '$state', '$stateParams', this.Run]);
                module.config(['$stateProvider', '$urlRouterProvider', this.Config]);
            }
            Main.prototype.Config = function ($stateProvider, $urlRouterProvider) {
                $urlRouterProvider.otherwise('/');
                $stateProvider
                    .state({
                    name: 'home',
                    url: '/',
                    templateUrl: 'templates/home.html',
                    controller: justinwatkins.HomeController,
                    controllerAs: 'home'
                })
                    .state({
                    name: 'resume',
                    url: '/resume',
                    templateUrl: 'templates/resume.html',
                    controller: justinwatkins.ResumeController,
                    controllerAs: 'resume'
                })
                    .state({
                    name: 'nested',
                    url: '/nested',
                    templateUrl: 'templates/nested.html',
                    controller: justinwatkins.NestedController,
                    controllerAs: 'nested'
                })
                    .state({
                    name: 'nested.child',
                    url: '/child',
                    templateUrl: 'templates/nestedChild.html',
                    controller: justinwatkins.NestedChildController,
                    controllerAs: 'child'
                });
            };
            Main.prototype.Run = function ($rootScope, $state, $stateParams) {
                $rootScope.$state = $state;
                $rootScope.$stateParams = $stateParams;
            };
            return Main;
        })();
        var app = new Main();
    })(justinwatkins = com.justinwatkins || (com.justinwatkins = {}));
})(com || (com = {}));

